\r\nWe believe that God is eternally existent in three distinct persons: Father, Son and Holy Spirit.\r\n\r\nWe believe that God is the personal, transcendent, and sovereign Creator of all things.\r\n\r\nWe believe that Jesus Christ is fully God and fully human, that He was born of a virgin, lived a sinless life, provided for the atonement of our sins by His substitutionary death on the cross, was bodily raised from the dead, ascended back to the right hand of the Father, and ever lives to make intercession for us.\r\n\r\nWe believe in the personal, visible, and pre-millennial second coming of Jesus Christ to the earth. He will return with His saints and set up a kingdom of which there will be no end.\r\n\r\nWe believe that all people are, by nature, separated from God and responsible for their own sin, but that salvation, redemption, and forgiveness are freely offered to all by the grace of our Lord Jesus Christ. When a person repents of sin and accepts Jesus Christ as personal Savior and Lord, trusting Him to save, that person is immediately born again and sealed by the Holy Spirit, all his/her sins are forgiven, and that person becomes a child of God, destined to spend eternity with the Lord.\r\n\r\nWe believe that after Jesus ascended to Heaven, He poured out His Holy Spirit on the believers in Jerusalem, enabling them to fulfill His command to preach the Gospel to the entire world, an obligation shared by all believers today.\r\n\r\nWe believe in the gifts of the Holy Spirit mentioned in the Scriptures, and that they are valid for today if they are exercised within the scriptural guidelines. We as believers are to covet the best gifts, seeking to exercise them in love that the whole Body of Christ might be edified. We believe that love is more important than the most spectacular gifts, and without this love all exercise of spiritual gifts is worthless.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:2094:\"<p>We believe in all the basic doctrines of historic Christianity.</p>\n<p>We believe in the inerrancy of Scripture, that the Bible, Old and New Testaments are the inspired, infallible Word of God.</p>\n<p>We believe that God is eternally existent in three distinct persons: Father, Son and Holy Spirit.</p>\n<p>We believe that God is the personal, transcendent, and sovereign Creator of all things.</p>\n<p>We believe that Jesus Christ is fully God and fully human, that He was born of a virgin, lived a sinless life, provided for the atonement of our sins by His substitutionary death on the cross, was bodily raised from the dead, ascended back to the right hand of the Father, and ever lives to make intercession for us.</p>\n<p>We believe in the personal, visible, and pre-millennial second coming of Jesus Christ to the earth. He will return with His saints and set up a kingdom of which there will be no end.</p>\n<p>We believe that all people are, by nature, separated from God and responsible for their own sin, but that salvation, redemption, and forgiveness are freely offered to all by the grace of our Lord Jesus Christ. When a person repents of sin and accepts Jesus Christ as personal Savior and Lord, trusting Him to save, that person is immediately born again and sealed by the Holy Spirit, all his/her sins are forgiven, and that person becomes a child of God, destined to spend eternity with the Lord.</p>\n<p>We believe that after Jesus ascended to Heaven, He poured out His Holy Spirit on the believers in Jerusalem, enabling them to fulfill His command to preach the Gospel to the entire world, an obligation shared by all believers today.</p>\n<p>We believe in the gifts of the Holy Spirit mentioned in the Scriptures, and that they are valid for today if they are exercised within the scriptural guidelines. We as believers are to covet the best gifts, seeking to exercise them in love that the whole Body of Christ might be edified. We believe that love is more important than the most spectacular gifts, and without this love all exercise of spiritual gifts is worthless.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1309050737,1),('field:node:8','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:27:\"Links to us in the press...\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:35:\"<p>Links to us in the press...</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1309048974,1),('field:node:9','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:20:\"Gospel message here.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:28:\"<p>Gospel message here.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1309029330,1),('field_info_fields','a:4:{s:6:\"fields\";a:4:{i:1;a:16:{s:12:\"entity_types\";a:1:{i:0;s:7:\"comment\";}s:12:\"translatable\";s:1:\"0\";s:8:\"settings\";a:0:{}s:7:\"storage\";a:5:{s:4:\"type\";s:17:\"field_sql_storage\";s:8:\"settings\";a:0:{}s:6:\"module\";s:17:\"field_sql_storage\";s:6:\"active\";s:1:\"1\";s:7:\"details\";a:1:{s:3:\"sql\";a:2:{s:18:\"FIELD_LOAD_CURRENT\";a:1:{s:23:\"field_data_comment_body\";a:2:{s:5:\"value\";s:18:\"comment_body_value\";s:6:\"format\";s:19:\"comment_body_format\";}}s:19:\"FIELD_LOAD_REVISION\";a:1:{s:27:\"field_revision_comment_body\";a:2:{s:5:\"value\";s:18:\"comment_body_value\";s:6:\"format\";s:19:\"comment_body_format\";}}}}}s:12:\"foreign keys\";a:1:{s:6:\"format\";a:2:{s:5:\"table\";s:13:\"filter_format\";s:7:\"columns\";a:1:{s:6:\"format\";s:6:\"format\";}}}s:7:\"indexes\";a:1:{s:6:\"format\";a:1:{i:0;s:6:\"format\";}}s:2:\"id\";s:1:\"1\";s:10:\"field_name\";s:12:\"comment_body\";s:4:\"type\";s:9:\"text_long\";s:6:\"module\";s:4:\"text\";s:6:\"active\";s:1:\"1\";s:6:\"locked\";s:1:\"0\";s:11:\"cardinality\";s:1:\"1\";s:7:\"deleted\";s:1:\"0\";s:7:\"columns\";a:2:{s:5:\"value\";a:3:{s:4:\"type\";s:4:\"text\";s:4:\"size\";s:3:\"big\";s:8:\"not null\";b:0;}s:6:\"format\";a:3:{s:4:\"type\";s:7:\"varchar\";s:6:\"l