INSERT INTO `regenera_field_revision_body` VALUES ('node','page',0,1,1,'und',0,'Welcome to Regeneration church.','','filtered_html'),('node','page',0,2,2,'und',0,'We are a group of believers in Jesus Christ. Our greatest desire is to know Him more fully and to become more like Him by the power of His Holy Spirit.\r\n\r\nWe Believe the worship of God should be intelligent. Therefore: We seek to understand Him through the revelation He has given us of Himself -- the Bible. We place great emphasis on the teaching of the Bible to learn who He is and how He desires to be worshipped.\r\n\r\nWe Believe the worship of God should be spiritual. Therefore: We choose to be flexible and yield our lives to the direction of the Holy Spirit.\r\n\r\nWe Believe the worship of God should be inspirational. Therefore: We give great place to music in our worship.\r\n\r\nWe Believe the worship of God should be fruitful. Therefore: We look for His love in our lives as evidence that we have been truly worshipping Him.\r\n\r\nWe Believe God desires to extend His love to all. Therefore: We welcome all to come and join us as we seek to worship Him in unity.','','filtered_html'),('node','page',0,4,4,'und',0,'Mission statement','','filtered_html'),('node','page',0,5,5,'und',0,'We believe in all the basic doctrines of historic Christianity.\r\n\r\nWe believe in the inerrancy of Scripture, that the Bible, Old and New Testaments are the inspired, infallible Word of God.\r\n\r\nWe believe that God is eternally existent in three distinct persons: Father, Son and Holy Spirit.\r\n\r\nWe believe that God is the personal, transcendent, and sovereign Creator of all things.\r\n\r\nWe believe that Jesus Christ is fully God and fully human, that He was born of a virgin, lived a sinless life, provided for the atonement of our sins by His substitutionary death on the cross, was bodily raised from the dead, ascended back to the right hand of the Father, and ever lives to make intercession for us.\r\n\r\nWe believe in the personal, visible, and pre-millennial second coming of Jesus Christ to the earth. He will return with His saints and set up a kingdom of which there will be no end.\r\n\r\nWe believe that all people are, by nature, separated from God and responsible for their own sin, but that salvation, redemption, and forgiveness are freely offered to all by the grace of our Lord Jesus Christ. When a person repents of sin and accepts Jesus Christ as personal Savior and Lord, trusting Him to save, that person is immediately born again and sealed by the Holy Spirit, all his/her sins are forgiven, and that person becomes a child of God, destined to spend eternity with the Lord.\r\n\r\nWe believe that after Jesus ascended to Heaven, He poured out His Holy Spirit on the believers in Jerusalem, enabling them to fulfill His command to preach the Gospel to the entire world, an obligation shared by all believers today.\r\n\r\nWe believe in the gifts of the Holy Spirit mentioned in the Scriptures, and that they are valid for today if they are exercised within the scriptural guidelines. We as believers are to covet the best gifts, seeking to exercise them in love that the whole Body of Christ might be edified. We believe that love is more important than the most spectacular gifts, and without this love all exercise of spiritual gifts is worthless.','','filtered_html'),('node','page',0,6,6,'und',0,'In April 1999, Regeneration started as a Bible study for people who had questions about God, but who did not necessarily connect with church. Three months later, the study outgrew the wee apartment where they had been meeting and moved to the back room of College Avenue\'s Mocha Lisa Coffeehouse.\r\n\r\nThe study thrived in its eclectic environment and welcomed the curious caffeine addicts who drifted in regularly. Eventually, the sound of the coffee grinders and the wanderings of restroom-seekers drove the would-be scholars to distraction and they set out to find an alternative dwelling.\r\n\r\nThe new home was a storage room. Though lacking glamour, heat, lighting, and ventilation, the study grew. It reached capacity, burst, and became a church. Regeneration opened in the imusicast studios in March 2001, and then moved to the old blue shag clad Seventh Day Adventist Church on Parker St. in Berkeley.\r\n\r\nThen, in summer of 2004, Regeneration got its very own building, on the corner of East 15th and 3rd in Oakland California, where God is continuing to do His work.\r\n\r\nDespite changes in size, format, and venue, Regeneration has remained true to its original purpose: to provide a home for people to seek out truth, worship God, be led by The Spirit, and participate in vibrant community.\r\n','','filtered_html'),('node','page',0,7,7,'und',0,'\r\n\r\n	\r\nAlbert Lee\r\nPastor\r\n\r\nAlbert was born in NYC and raised in Los Angeles before coming to the Bay Area. Albert graduated from Azusa Pacific University, attended the pastoral school at Calvary Chapel Golden Springs, and has been with Regeneration since 2000. Albert lives with his wife Katy, his daughters Isabella, Siena, and Genevieve, and his dog Joey in an undisclosed Ninja commune.\r\n\r\n\r\n\r\n	\r\nKaty Lee\r\nEarly Childhood Ministry Director\r\n\r\nKaty Lee was born and raised primarily in Oakland, and graduated from Cal State East Bay with a degree in English Lit and a Multiple Subject Teaching Credential. She gave her life to Jesus while attending a youth group in high school, and has been going to Regeneration since 2002. Her experience with children includes 9 years of teaching preschool, volunteering as a Jr. High Sunday School teacher, spending a year as an au pair in Spain, and, most importantly, having 3 kids of her own. She has been serving in Regeneration\'s Children\'s Ministry since 2007. For her current whereabouts, see Albert\'s bio above. \r\n\r\n\r\n\r\n	\r\nElaine McIntyre\r\nWorship Leader\r\n\r\nTexas-born, Tennessee-cradled, Oklahoma-raised, Jesus-loving wild child Elaine received her music degree from UC Berkeley and has written songs since 1991, the first entitled \"The Friendship of Loving,\" which spent weeks on her best friend\'s favorite mixtape. Elaine\'s latest songs can be found on the Regen worship blog. In 2007 God stirred her heart to find a church body authentically and passionately serving local and global neighbors; He led her to Regen, where interns have challenged her since the first day she arrived. She has suited up, battle-ready for worship (and interns) since 2008 and wants to be a Bible nerd when she grows up. Her worship motto is: \"Where the Spirit of the Lord is, there is freedom.\"\r\n\r\n\r\n\r\n	\r\nRenee Boyd\r\nBookkeeper\r\n\r\nRenee was raised in Los Angeles, had a warm and sultry stay in Georgia, and finally made her way to the Bay Area. She graduated from Azusa Pacific some time ago, majoring in Business Administration. She has been attending Regen since 2002 and currently lives in Oakland.\r\n\r\n\r\n\r\n	\r\nSergio DiMartino\r\nAdmin\r\n\r\nBorn and raised (and saved) in Southern California, Sergio spent nine formative years in Michigan before being called back to California in 2007 and being called into ministry. In January of 2009, Sergio married the love of his life (Alex, a mysterious and exotic lady hailing from the far East... Bay). In April of the same year, Sergio and Alex were called to live and serve in Oakland, where they have been attending Regeneration ever since. They love the city and people of Oakland and plan to stay here forever. Or at least until the Lord calls them elsewhere... [cue dramatic music]\r\n\r\n\r\n\r\n	\r\nChristina Chen\r\nChildren\r\n\r\nChristina was born in Taiwan and grew up in Davis but ran away to Berkeley for college. She then put her science degree to good use by getting an Elementary Education MA and returning to Kindergarten, where she had an amazing year with 20 unforgettable children. She now serves kids at and around Regen and also works at Modern Mouse, a cute gift shop in Alameda. She\'s been with Regeneration for over two years and is a Funktown-ster. \r\n\r\n\r\n\r\n	\r\nDave Kim\r\nCommunity / Art\r\n\r\nDavid Kim was born in the heart of the small town of Los Angeles in California. His family later moved to an even smaller town called Torrance where he attended junior high and middle school. Upon graduation from UC Davis with a degree in Art and his first felony, David moved to San Francisco. For four years worked for a marvelous biotech, while painting in his studio on the side, but after a series of events and being convicted of living a self centered life he quit his job and moved across the bridge. David now resides in Oakland, between a church and an organic garden in the district known as Funktown. He hella loves it. \r\n\r\n\r\n\r\n	\r\nNathan VanNortwick\r\nHome Groups / Youth / Global Missions\r\n\r\nBorn and raised in San Diego (apart from a very long year in the Great White North), attended college at UC Berkeley majoring in Film Studies, he has been attending Regen since 2003 (off and on for the first couple years) and currently lives in Oakland with 4 of the 7 dwarfs (Nathan sometimes likes to think of himself as Snow White) (and Nathan likes to use parentheses and talk about himself in the third-person). \r\n\r\n\r\n\r\nThe Interns:\r\n\r\n\r\n \r\n\r\nEric\r\n\r\nEric grew up in the suburbs of LA, 30 miles from downtown. He started attending Regeneration Church in 2002 when he was at Cal and they were still at iMusicast and he couldn\'t wake up in time for other church services before 6 pm. He decided to do the internship when Dave Kim told him to and then prayed that he would lose his job. So he lost his job and started interning. Eric thinks the best part about interning is the food donations people bring to church when they find out from his biography that the best part about interning is the food donations.\r\n\r\nKen\r\n\r\nKen was born in Hong Kong and came to the US for college. He is a fob. His first impression of Regen was that people were way too cool for him. A few years later he realised that really they were all sinners in the hands of a loving God and that Regen was cool for him too. Ken decided to intern after the Urbana 09 and decided not to shave until he made a commitment. He is currently trying to get out from a career turning baby seals into barrels of crude oil and pursue a career less evil. \r\n\r\nZach\r\n\r\nUpon observing postmodern tendencies towards emphasizing what some would call \"etch-a-sketch-o-everyday-life,\" Zach wrote a song. It goes something like this: \r\n\r\nJesus paved the way \r\n-------clap----------------clap \r\n\r\nfrom Tejas to the bay \r\n---------------clap--------clap \r\n\r\nit was a shadow of the greater road \r\n-----------clap--------------clap----------- \r\nto heaven from the grave. \r\n---clap------------------clap \r\n\r\no yeah ya\'ll! \r\n\r\nAndrew\r\n\r\nAndrew joined Regen in 2009 shortly after he graduated from UC Berkeley. He\'s passionate about programming, words, graphic design, and Jesus, not in that order. He\'s most excited about living in community for the internship, and In-n-Out milkshake runs. And the taco truck. In that order. ','','filtered_html'),('node','page',0,8,8,'und',0,'Links to us in the press...','','filtered_html'),('node','page',0,9,9,'und',0,'Gospel message here.','','filtered_html'),('node','page',0,10,10,'und',0,'Regeneration\r\n238 E 15th St\r\nOakland, CA 94606\r\nClick here for Map & Driving Directions\r\n\r\nMailing Address\r\nRegeneration\r\nP.O. Box 10045\r\nOakland, CA 94610\r\n\r\nServices @ 9 AM & 6 PM\r\n\r\n(ph)  510.444.2950\r\n(fax) 510.444.3656 \r\n\r\nQuestions?\r\n\r\nEmail Albert: Pastor\r\nalbert@regenerationweb.com \r\n\r\nEmail Elaine: Worship Leader\r\nelaine@regenerationweb.com \r\n\r\nEmail Renee: Bookkeeper\r\nbookkeeper@regenerationweb.com \r\n\r\nEmail Sergio DiMartino: Administration\r\nsergio@regenerationweb.com \r\n\r\nEmail Dave Kim: \r\ndave@regenerationweb.com \r\n\r\nEmail Nate: \r\nnate@regenerationweb.com ','','filtered_html'),('node','page',0,11,11,'und',0,'There are 2 ways you can support the ministry and the mission of Regeneration.\r\n\r\nFirst and foremost is in prayer. Please keep us in your prayers.\r\n\r\nYou can also support us financially, \r\nWith a tax deductible donation to:\r\nRegeneration\r\nP.O. Box 10045\r\nOakland, CA 94610\r\n\r\nRegeneration would also like to support you in prayer. Feel free email us at jesuswins@gmail.com','','filtered_html'),('node','page',0,14,14,'und',0,'Bawk bawk.','','filtered_html'),('node','page',0,16,16,'und',0,'La Escuelita','','filtered_html'),('node','page',0,19,19,'und',0,'(This should have a custom view of upcoming events, sorted by upcoming-ness)','','filtered_html'),('node','page',0,20,20,'und',0,'Community bulletin board. Probably the Google Spreadsheets widget we usually use?','','filtered_html'),('node','page',0,21,21,'und',0,'List of home groups.','','filtered_html'),('node','page',0,22,22,'und',0,'HG info here.','','filtered_html'),('node','page',0,23,23,'und',0,'HG info here.','','filtered_html'),('node','page',0,24,24,'und',0,'HG info here.','','filtered_html'),('node','page',0,25,25,'und',0,'HG info here.','','filtered_html'),('node','page',0,26,26,'und',0,'HG info here.','','filtered_html'),('node','page',0,28,28,'und',0,'Kylan Group\r\nNate Group','','filtered_html'),('node','page',0,29,29,'und',0,'Alex Group\r\nSaturday Testimonial Group (Daphne)','','filtered_html'),('node','page',0,30,30,'und',0,'Meet at the Alley. Augustine\'s Confessions.','','filtered_html'),('node','page',0,31,31,'und',0,'Circuit Training\r\nTriathlon Team\r\nRun Team','','filtered_html'),('node','page',0,33,33,'und',0,'<p>\r\n	Location:</p>\r\n<p>\r\n	Time:</p>\r\n<p>\r\n	Childcare:</p>\r\n','','filtered_html'),('node','page',0,34,34,'und',0,'Before Sunday AM\r\nBefore Sunday PM\r\nWednesday morning\r\nPray Oakland','','filtered_html'),('node','page',0,35,35,'und',0,'<p>\r\n	(Custom view?)</p>\r\n<p>\r\n	<img alt=\"\" src=\"/sites/default/files/banner_messages.jpg\" style=\"width: 761px; height: 146px;\" /></p>\r\n<ul>\r\n	<li>\r\n		reverse list of recent podcasts.</li>\r\n	<li>\r\n		maybe sort by date?</li>\r\n	<li>\r\n		Player iTunes link to podcast.</li>\r\n</ul>\r\n','','filtered_html'),('node','page',0,36,36,'und',0,'Front page content.','','filtered_html');
