INSERT INTO `regenera_search_dataset` VALUES (1,'node',' who we are welcome to regeneration church  ',0),(2,'node',' statement of beliefs we are a group of believers in jesus christ our greatest desire is to know him more fully and to become more like him by the power of his holy spirit we believe the worship of god should be intelligent therefore we seek to understand him through the revelation he has given us of himself the bible we place great emphasis on the teaching of the bible to learn who he is and how he desires to be worshipped we believe the worship of god should be spiritual therefore we choose to be flexible and yield our lives to the direction of the holy spirit we believe the worship of god should be inspirational therefore we give great place to music in our worship we believe the worship of god should be fruitful therefore we look for his love in our lives as evidence that we have been truly worshipping him we believe god desires to extend his love to all therefore we welcome all to come and join us as we seek to worship him in unity  ',0),(4,'node',' mission statement mission statement  ',0),(5,'node',' doctrine we believe in all the basic doctrines of historic christianity we believe in the inerrancy of scripture that the bible old and new testaments are the inspired infallible word of god we believe that god is eternally existent in three distinct persons father son and holy spirit we believe that god is the personal transcendent and sovereign creator of all things we believe that jesus christ is fully god and fully human that he was born of a virgin lived a sinless life provided for the atonement of our sins by his substitutionary death on the cross was bodily raised from the dead ascended back to the right hand of the father and ever lives to make intercession for us we believe in the personal visible and premillennial second coming of jesus christ to the earth he will return with his saints and set up a kingdom of which there will be no end we believe that all people are by nature separated from god and responsible for their own sin but that salvation redemption and forgiveness are freely offered to all by the grace of our lord jesus christ when a person repents of sin and accepts jesus christ as personal savior and lord trusting him to save that person is immediately born again and sealed by the holy spirit all his her sins are forgiven and that person becomes a child of god destined to spend eternity with the lord we believe that after jesus ascended to heaven he poured out his holy spirit on the believers in jerusalem enabling them to fulfill his command to preach the gospel to the entire world an obligation shared by all believers today we believe in the gifts of the holy spirit mentioned in the scriptures and that they are valid for today if they are exercised within the scriptural guidelines we as believers are to covet the best gifts seeking to exercise them in love that the whole body of christ might be edified we believe that love is more important than the most spectacular gifts and without this love all exercise of spiritual gifts is worthless  ',0),(6,'node',' history in april 1999 regeneration started as a bible study for people who had questions about god but who did not necessarily connect with church three months later the study outgrew the wee apartment where they had been meeting and moved to the back room of college avenue s mocha lisa coffeehouse the study thrived in its eclectic environment and welcomed the curious caffeine addicts who drifted in regularly eventually the sound of the coffee grinders and the wanderings of restroomseekers drove the wouldbe scholars to distraction and they set out to find an alternative dwelling the new home was a storage room though lacking glamour heat lighting and ventilation the study grew it reached capacity burst and became a church regeneration opened in the imusicast studios in march 2001 and then moved to the old blue shag clad seventh day adventist church on parker st in berkeley then in summer of 2004 regeneration got its very own building on the corner of east 15th and 3rd in oakland california where god is continuing to do his work despite changes in size format and venue regeneration has remained true to its original purpose to provide a home for people to seek out truth worship god be led by the spirit and participate in vibrant community  ',0),(7,'node',' staff albert lee pastor albert was born in nyc and raised in los angeles before coming to the bay area albert graduated from azusa pacific university attended the pastoral school at calvary chapel golden springs and has been with regeneration since 2000 albert lives with his wife katy his daughters isabella siena and genevieve and his dog joey in an undisclosed ninja commune katy lee early childhood ministry director katy lee was born and raised primarily in oakland and graduated from cal state east bay with a degree in english lit and a multiple subject teaching credential she gave her life to jesus while attending a youth group in high school and has been going to regeneration since 2002 her experience with children includes 9 years of teaching preschool volunteering as a jr high sunday school teacher spending a year as an au pair in spain and most importantly having 3 kids of her own she has been serving in regeneration s children s ministry since 2007 for her current whereabouts see albert s bio above elaine mcintyre worship leader texasborn tennesseecradled oklahomaraised jesusloving wild child elaine received her music degree from uc berkeley and has written songs since 1991 the first entitled the friendship of loving which spent weeks on her best friend s favorite mixtape elaine s latest songs can be found on the regen worship blog in 2007 god stirred her heart to find a church body authentically and passionately serving local and global neighbors he led her to regen where interns have challenged her since the first day she arrived she has suited up battleready for worship and interns since 2008 and wants to be a bible nerd when she grows up her worship motto is where the spirit of the lord is there is freedom renee boyd bookkeeper renee was raised in los angeles had a warm and sultry stay in georgia and finally made her way to the bay area she graduated from azusa pacific some time ago majoring in business administration she has been attending regen since 2002 and currently lives in oakland sergio dimartino admin born and raised and saved in southern california sergio spent nine formative years in michigan before being called back to california in 2007 and being called into ministry in january of 2009 sergio married the love of his life alex a mysterious and exotic lady hailing from the far east bay in april of the same year sergio and alex were called to live and serve in oakland where they have been attending regeneration ever since they love the city and people of oakland and plan to stay here forever or at least until the lord calls them elsewhere cue dramatic music christina chen children christina was born in taiwan and grew up in davis but ran away to berkeley for college she then put her science degree to good use by getting an elementary education ma and returning to kindergarten where she had an amazing year with 20 unforgettable children she now serves kids at and around regen and also works at modern mouse a cute gift shop in alameda she s been with regeneration for over two years and is a funktownster dave kim community art david kim was born in the heart of the small town of los angeles in california his family later moved to an even smaller town called torrance where he attended junior high and middle school upon graduation from uc davis with a degree in art and his first felony david moved to san francisco for four years worked for a marvelous biotech while painting in his studio on the side but after a series of events and being convicted of living a self centered life he quit his job and moved across the bridge david now resides in oakland between a church and an organic garden in the district known as funktown he hella loves it nathan vannortwick home groups youth global missions born and raised in san diego apart from a very long year in the great white north attended college at uc berkeley majoring in film studies he has been attending regen since 2003 off and on for the first couple years and currently lives in oakland with 4 of the 7 dwarfs nathan sometimes likes to think of himself as snow white and nathan likes to use parentheses and talk about himself in the thirdperson the interns eric eric grew up in the suburbs of la 30 miles from downtown he started attending regeneration church in 2002 when he was at cal and they were still at imusicast and he couldn t wake up in time for other church services before 6 pm he decided to do the internship when dave kim told him to and then prayed that he would lose his job so he lost his job and started interning eric thinks the best part about interning is the food donations people bring to church when they find out from his biography that the best part about interning is the food donations ken ken was born in hong kong and came to the us for college he is a fob his first impression of regen was that people were way too cool for him a few years later he realised that really they were all sinners in the hands of a loving god and that regen was cool for him too ken decided to intern after the urbana 9 and decided not to shave until he made a commitment he is currently trying to get out from a career turning baby seals into barrels of crude oil and pursue a career less evil zach upon observing postmodern tendencies towards emphasizing what some would call etchasketchoeverydaylife zach wrote a song it goes something like this jesus paved the way clap clap from tejas to the bay clap clap it was a shadow of the greater road clap clap to heaven from the grave clap clap o yeah ya ll andrew andrew joined regen in 2009 shortly after he graduated from uc berkeley he s passionate about programming words graphic design and jesus not in that order he s most excited about living in community for the internship and innout milkshake runs and the taco truck in that order  ',0),(8,'node',' press links to us in the press  ',0),(9,'node',' gospel gospel message here  ',0),(10,'node',' contact regeneration 238 e 15th st oakland ca 94606 click here for map driving directions mailing address regeneration po box 10045 oakland ca 94610 services 9 am 6 pm ph 5104442950 fax 5104443656 questions email albert pastor albert regenerationwebcom email elaine worship leader elaine regenerationwebcom email renee bookkeeper bookkeeper regenerationwebcom email sergio dimartino administration sergio regenerationwebcom email dave kim  dave regenerationwebcom email nate  nate regenerationwebcom ',0),(11,'node',' give support there are 2 ways you can support the ministry and the mission of regeneration first and foremost is in prayer please keep us in your prayers you can also support us financially with a tax deductible donation to regeneration po box 10045 oakland ca 94610 regeneration would also like to support you in prayer feel free email us at jesuswins gmailcom ',0),(12,'node',' neighborhood world ',0),(13,'node',' cross streets ',0),(14,'node',' funk town farm bawk bawk  ',0),(15,'node',' tae kwon do classes ',0),(16,'node',' tutoring la escuelita  ',0),(17,'node',' missions ',0),(18,'node',' connect commune ',0),(19,'node',' events  this should have a custom view of upcoming events sorted by upcomingness  ',0),(20,'node',' bulletin board community bulletin board probably the google spreadsheets widget we usually use  ',0),(21,'node',' home groups list of home groups  ',0),(22,'node',' upper lakeshore hg info here  ',0),(23,'node',' dimond hg info here  ',0),(24,'node',' deep dish e lake merritt  hg info here  ',0),(25,'node',' adelphoi young adult  hg info here  ',0),(26,'node',' familyfriendly hg info here  ',0),(27,'node',' interest groups ',0),(28,'node',' men s groups kylan group nate group  ',0),(29,'node',' women s group alex group saturday testimonial group daphne  ',0),(30,'node',' book club meet at the alley augustine s confessions  ',0),(31,'node',' fitness circuit training triathlon team run team  ',0),(32,'node',' worship ',0),(33,'node',' sunday service location time childcare  ',0),(34,'node',' prayer before sunday am before sunday pm wednesday morning pray oakland  ',0),(35,'node',' online messages  custom view reverse list of recent podcasts maybe sort by date player itunes link to podcast  ',0),(36,'node',' front front page content  ',0);
